INSERT INTO `course` VALUES (13,'Harbinger Group Trainee Induction Program 2009','<p dir=\"ltr\" style=\"margin-right:0px;\">The objective of this induction program was to help MCS and MCA trainees understand various aspects of the organization like cutting edge technologies being used in products and projects, domain specific details, latest software development and management methodologies, practices/ processes being followed, various development and testing tools being used etc.    </p>',1178,'2009-02-25 05:03:37','Harbinger Group Trainee Induction 2009',5,20881,'Harbinger Group Trainee Induction Program 2009','HGI001',1,'weeks',1,7,1229904000,1234144800,7,2097152,0,1,0,0,0,1259920498,0,0,'',''),(16,'ExtJS','<p dir=\"ltr\" style=\"margin-right:0px;\">The objective of this training was to give an idea about ExtJS cross-browser javascript library, components and widgets provided in ExtJS.</p>',-342984,'2009-03-05 11:13:02','ExtJS',5,20886,'ExtJS','',1,'topics',1,5,1234742400,0,3,2097152,1,1,0,0,0,1251115920,0,0,'',''),(20,'Scorm 2004 course','This is a scorm 2004 based course.',-344088,'2009-04-02 09:46:38','Scorm1234',6,10333,'Scorm 2004 course','12345',1,'singleactivity',1,5,1238716800,0,1,41943040,0,0,0,0,0,1238665598,0,0,'',''),(21,'Scorm 1.2','Welcome to Scorm 1.2 course',-344088,'2009-04-02 09:50:54','Scorm123',6,10334,'Scorm 1.2','sc12345',1,'singleactivity',1,5,1238716800,0,0,41943040,0,0,0,0,0,1238665854,0,0,'',''),(23,'Single Page Assessment ','fdfdf ',-344088,'2009-04-02 12:01:28','New one',6,10335,'Single Page Assessment ','Single Page Assessment 123',1,'singleactivity',1,5,1238716800,0,0,41943040,0,0,0,0,0,1238674573,0,0,'',''),(26,'Income Tax Planning','Income Tax Planning ',-345090,'2009-05-14 11:11:49','ITP',9,50016,'Income Tax Planning','',1,'singleactivity',1,5,1242325800,0,10,5242880,0,1,0,0,0,1317624629,0,0,'en',''),(27,'eLearning workshop 13 June 2009','<br /><p class=\"MsoNormal\"><font size=\"2\" face=\"Arial\" color=\"#000080\"><span style=\"font-size:10pt;color:#000080;font-family:arial;\">The objective of this workshop was </span></font><font size=\"2\" face=\"Arial\" color=\"#1f497d\"><span style=\"font-size:10pt;color:rgb(31,73,125);font-family:arial;\">to get an overview of different eLearning projects in Harbinger and improve audiance knowledge on some core eLearning topics such as eLearning standards (AICC, SCORM, etc), new trends in eLearning, testing of eLearning applications.</span></font></p><p></p><p></p> ',-345738,'2009-06-23 10:50:43','eLearning workshop 13 June 2009',5,20887,'eLearning workshop 13 June 2009','',1,'topics',1,5,1244658600,0,4,5242880,0,1,0,0,0,1317624801,0,0,'',''),(29,'Template - Course with Weekly format (in progress)','test ',1682,'2009-06-25 12:31:25','CF1010',6,10336,'Template - Course with Weekly format (in progress)','',1,'weeks',1,5,1245456000,1251511200,10,5242880,0,0,0,0,0,1246341592,0,0,'',''),(30,'Template - Course with Topics format (in progress)','',-346104,'2009-06-25 13:10:19','CF1011',6,10338,'Template - Course with Topics format (in progress)','',1,'topics',1,5,1245974400,0,10,5242880,0,0,0,0,0,1288290489,0,0,'',''),(33,'Restored from weekly template','test',1682,'2009-06-25 12:31:25','CF1020',6,10337,'Restored from weekly template','',1,'weeks',1,5,1245456000,1251511200,10,5242880,0,0,0,0,0,1245937913,0,0,'',''),(35,'.NET Migration (From 1.1 to 3.5)',' Migrating .NET 1.1 to 2.0/ 3.5 ',170,'2009-08-06 08:40:57','.NET Migration (From 1.1 to 3.5)',5,20888,'.NET Migration (From 1.1 to 3.5)','',1,'weeks',1,5,1235932200,1236544200,1,5242880,0,1,0,0,0,1317629838,0,0,'',''),(36,'Basic Scripting','<br /><p><font size=\"2\"><font face=\"Verdana\" color=\"#330066\">The objective of this training is to introduce scripting to our Test Engineers working in various projects. It includes training on </font><font face=\"verdana,arial,helvetica,sans-serif\" color=\"#330066\">1) Programming Concepts </font><font face=\"verdana,arial,helvetica,sans-serif\" color=\"#330066\">2) Command Line Scripting </font><font face=\"verdana,arial,helvetica,sans-serif\" color=\"#330066\">3) VB Scripting </font><font face=\"verdana,arial,helvetica,sans-serif\" color=\"#330066\">4) JScripting </font><font face=\"verdana,arial,helvetica,sans-serif\" color=\"#330066\">5) XML </font><font face=\"verdana,arial,helvetica,sans-serif\" color=\"#330066\">6) Ruby </font><font face=\"verdana,arial,helvetica,sans-serif\" color=\"#330066\">7) AutoIT</font></font></p><pre></pre><pre></pre> ',1682,'2009-08-07 11:59:53','Basic Scripting',5,20889,'Basic Scripting','',1,'weeks',0,5,1249842600,1255897800,10,5242880,0,1,0,0,0,1317630809,0,0,'',''),(37,'Flash CS4 Insight','This is a summary course gives a birds eye view of the upcoming Flash CS4 version and its new features.<br />\r\n<br />\r\nVishal Adsool, the author of this course attended a seminar on Flash CS4 held at Hotel Le\'Meridian by Adobe.',-347280,'2009-08-13 06:41:42','CF105',8,40016,'Flash CS4 Insight','',1,'singleactivity',0,5,1250208000,0,52,5242880,0,1,0,0,0,1250146290,0,0,'en',''),(38,'Processes and Templates to be followed by DEV-QA','<br /><p style=\"margin:0in 0in 0pt;\" class=\"MsoNormal\"><span>This course has various processes and templates to be followed by developers and QA\'s. It helps in keeping track of different activities in a project and having a better communication protocol between developers and QA\'s.</span></p> ',-344322,'2009-08-14 06:43:49','Processes and Templates to be followed by DEV-QA',5,20890,'Processes and Templates to be followed by DEV-QA','',1,'topics',1,5,1239561000,0,3,5242880,0,1,0,0,0,1317631037,0,0,'',''),(40,'Email writing coaching','<br />\r <p>This course is intended to give the student an overview of different facets of writing an email. </p><p>This training session was conducted by Rahul Mulay, GM - Operations for entire HTV division.</p> ',-346890,'2009-08-21 04:27:10','Email writing',9,50015,'Email writing coaching','SSMW-01',1,'topics',1,5,1248805800,0,1,5242880,0,1,0,0,0,1317631134,0,0,'',''),(41,'SQL Database Training','<br /><p><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"font-size:10pt;font-family:arial;\"><font color=\"#333366\">This course has SQL Database basic training for developers and QA\'s. Which includes Basic Database Concepts, An Introduction to Transact SQL, Beginning Transact SQL and Intermediate Transact SQL.</font></span></span></p><p><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"font-size:10pt;font-family:arial;\"><font color=\"#333366\">This training was conducted by Ashok Gaikwad, DBA for MS QA team members.</font></span></span></p> ',338,'2009-08-24 04:54:21','SQLTraining',5,20891,'SQL Database Training','',1,'weeks',1,5,1250533800,1251750600,2,5242880,0,1,0,0,0,1317631436,0,0,'',''),(43,'Application Design Patterns and Principles','<br /><p><span lang=\"en-in\" style=\"font-size:11pt;line-height:115%;font-family:calibri;\" xml:lang=\"en-in\">This training aims at introducing participants to effective Object Oriented Design Principles, practices and patterns. This foundation course will help candidate in understanding and using advanced patterns and designs like J2EE patterns.</span></p><p style=\"margin-right:0px;\" dir=\"ltr\"><span lang=\"en-in\" style=\"font-size:11pt;line-height:115%;font-family:calibri;\" xml:lang=\"en-in\">This training program was conducted by an external faculty who works as Corporate Trainer and Mentor with leading software and Technology companies.</span></p> ',506,'2009-08-24 12:33:41','Application Design Patterns and Principles',5,20892,'Application Design Patterns and Principles','',1,'weeks',1,5,1242930600,1244752200,3,5242880,0,1,0,0,0,1405417737,0,0,'',''),(45,'Introduction to XML-XSD-XSLT','<br /><p style=\"margin-right:0px;\" dir=\"ltr\">The objective of this training is to give an introduction on XML, XSD &amp; XSLT.</p> ',170,'2009-09-02 23:01:13','Introduction to XML-XSD-XSLT',5,20893,'Introduction to XML-XSD-XSLT','',1,'weeks',1,5,1247769000,1248381000,1,5242880,0,1,0,0,0,1317631854,0,0,'',''),(46,'Human-Computer Interaction Design and Usability Practices','<p><span class=\"Apple-style-span\" style=\"word-spacing:0px;font:16px \'times new roman\';text-transform:none;color:rgb(0,0,0);text-indent:0px;white-space:normal;letter-spacing:normal;border-collapse:separate;\"><span class=\"Apple-style-span\" style=\"font-size:13px;line-height:19px;font-family:\'trebuchet ms\';border-collapse:collapse;\">This course is for working professionals who want to do interaction design, information architecture or usability evaluation.<span class=\"Apple-converted-space\"> It</span></span></span><span class=\"Apple-style-span\" style=\"word-spacing:0px;font:16px \'times new roman\';text-transform:none;color:rgb(0,0,0);text-indent:0px;white-space:normal;letter-spacing:normal;border-collapse:separate;\"><span class=\"Apple-style-span\" style=\"font-size:13px;line-height:19px;font-family:\'trebuchet ms\';border-collapse:collapse;\"> is an exposure to user studies, interaction design, usability evaluation and user experience metrics.</span></span></p><p><span class=\"Apple-style-span\" style=\"word-spacing:0px;font:16px \'times new roman\';text-transform:none;color:rgb(0,0,0);text-indent:0px;white-space:normal;letter-spacing:normal;border-collapse:separate;\"><span class=\"Apple-style-span\" style=\"font-size:13px;line-height:19px;font-family:\'trebuchet ms\';border-collapse:collapse;\">This 10 day workshop was arranged by IIT Bombay and was attended by Vibhuti Agarwal, Graphic Expert.</span></span></p>',338,'2009-09-07 11:39:05','HCI',5,20894,'Human-Computer Interaction Design and Usability Practices','',1,'weeks',1,5,1252368000,1253584800,2,5242880,0,1,0,0,0,1253774269,0,0,'',''),(49,'Microsoft Silverlight 3.0 - Basic Training (Internal)',' This course is intended for providing basic knowledge on Microsoft Silverlight 3.0. The course covers the following areas:<br /><ul><li>Silverlight architecture, work flow, XAML, xap file format<br /></li><li>LINQ to SQL <br /></li><li>Databinding </li><li>WCF - Web services<br /></li><li>Microsoft Expression Blend - Basics </li><li>Out of browser usage </li></ul>Prerequisite: ASP.NET, C#, XML<br />',338,'2009-09-10 09:57:42','Silverlight 3.0 - Basic Training',5,20895,'Microsoft Silverlight 3.0 - Basic Training (Internal)','',1,'weeks',1,5,1253471400,1254688200,2,5242880,0,1,0,0,0,1317706642,0,0,'',''),(50,'Microsoft Silverlight 3.0 - Basic Training - 3 days workshop at Seed Infotech','<br /><p>This course is intended for providing basic knowledge on Microsoft Silverlight 3.0. The course covers the following areas:<br /></p><ul><li>Silverlight architecture, work flow, XAML, xap file format<br /></li><li>LINQ to SQL <br /></li><li>Databinding </li><li>WCF - Web services<br /></li><li>Microsoft Expression Blend - Basics </li><li>Out of browser usage </li></ul>Prerequisite: ASP.NET, C#, XML ',170,'2009-09-11 12:53:31','MS SIL 3.0',5,20896,'Microsoft Silverlight 3.0 - Basic Training - 3 days workshop at Seed Infotech','',1,'weeks',1,5,1249583400,1250195400,1,5242880,0,1,0,0,0,1317706818,0,0,'',''),(51,'User Experience Design','<p class=\"MsoNormal\" style=\"margin:0in 0in 0pt;\"><span>This training session was conducted by Atul Joshi, the chief Course Instructor of Design Incubator firm.</span></p><p class=\"MsoNormal\" style=\"margin:0in 0in 0pt;\"><span></span></p><p class=\"MsoNormal\" style=\"margin:0in 0in 0pt;\"><span></span></p><p class=\"MsoNormal\" style=\"margin:0in 0in 0pt;\"><span>This course covers information about the process followed in designing any product as well as elearning courses. You will find information about various phases of ADDIE model mapping to the design process. Also information related to structural approach to GUI visualization and prototype is covered in this course. </span></p>',-348096,'2009-09-16 09:22:56','UED',7,30048,'User Experience Design','',1,'topics',1,5,1253145600,0,1,5242880,0,1,0,0,0,1253772915,0,0,'',''),(52,'Flash Training (Aug 2009)','Macromedia coined the term rich Internet application (RIA). RIAs combine the flexibility, responsiveness, and ease of use of desktop applications with the broad reach of the web. RIAs provide a dynamic web experience that is rich and engaging, as well as interactive. Many web designers and developers use Adobe Flash or Adobe Flex, which are part of the Adobe Flash Platform, to build RIAs. Flash is an authoring environment for creating rich, interactive content for the web. Flex is a cross-platform development framework for creating RIAs. Content created with Flash and Flex is deployed using Adobe Flash Player. This course explores the basics of creating RIA\'s using the Flash Technology. The primary focus of this course revolves around action scripting. ',1346,'2009-08-07 11:59:53','Flash Training - Aug 2009',8,40017,'Flash Training (Aug 2009)','',1,'weeks',0,5,1251158400,1256004000,8,5242880,0,1,0,0,0,1257165827,0,0,'',''),(53,'Quality Management System','<br />\r <p>A quality management system in accordance with ISO 9001:2000 provides a set of processes that ensures a common approach to the management of the organization. </p><p>The system ensures consistency and improvement of working practices, which in turn provides products and services that meet customer\'s requirements. ISO 9000 is the most commonly used international standard that provides a framework for an effective quality management system. </p> ',-348114,'2009-09-17 10:54:21','QMS',9,50014,'Quality Management System','',1,'topics',1,5,1253212200,0,1,5242880,0,1,0,0,0,1317707026,0,0,'',''),(54,'Innovation Offsite 2009','Innovation Offsite 2009 ',-348282,'2009-09-24 06:40:27','CF109',8,40015,'Innovation Offsite 2009','',1,'singleactivity',0,5,1253817000,0,0,5242880,0,1,0,0,0,1317803857,0,0,'en',''),(55,'Innovation Factory - Presentation by Vikas','This is the presentation that Vikas gave at the \"Innovation Offsite 2009\".',-348